function activate() {
    this.active = true;
    this.applyStyle({borderColor: Color.green});
    this.initialSync();
    var that = this;
    this.getDB().startPollingChanges(function (change) {
        if(typeof change === "object"){
            if (change.deleted) {
                // only whole deletion of whiteboard possible right now
                that.clear(true);
            } else {
                // XXX no support for multiple parallel boards
                var document = that.getDB().open(change.id);
                if (document.drawer != that.getDrawerID()) {
                    that.drawLineFrom(document);
                }
            }
        } else {
            alert("change is no object");
        }
    },
    function(e){
        alert(e);
        throw(e);
    });
}

