function moveTo(point, sync, optTransform) {
    var pos = point;
    if (optTransform) {
        pos = this.transformPoint(pos);
    }
    if (sync) {
        if (this.getPointQueue().length > 0) {
            this.getPointQueue().push([-1, -1]);
        }
        this.getPointQueue().push([pos.x, pos.y]);
    }
    var ctx = this.getDrawingContext();
    ctx.beginPath();
    ctx.moveTo(pos.x, pos.y);
}

