function lineTo(point, sync, optTransform, color) {
    var pos = point;
    if (optTransform) {
        pos = this.transformPoint(pos);
    }
    if (sync) {
        this.getPointQueue().push([pos.x, pos.y]);
    }
    var ctx = this.getDrawingContext();
    if (color) {
        ctx.strokeStyle = color.toString();
    } else {
        ctx.strokeStyle = "rgb(0,0,0)";
    }
    ctx.lineTo(pos.x, pos.y);
    ctx.stroke();
}

