function syncPointQueueToDatabase() {
    if (this.active) {
        var queue = this.getPointQueue();
        for (var i=0; i < queue.length-1; i++) {
            var start = queue[i],
                end = queue[i+1];
            if (end == [-1, -1]) {
                continue;
            }
            var document = {
                board: "example",
                time: Date.now(),
                drawer: this.getDrawerID(),
                startPoint: start,
                endPoint: end
            };
            var result = this.getDB().save(document);
            if (result.error == "conflict") {
                console.log("an error occured while synching the whiteboard");
            }
        }
    }
}

